import logo from './logo.svg';
import './App.css';
import BoxImage from './components/BoxImage/Index';
import ButtonRefrest from './components/ButtonRefresh/Index';
import { useState } from 'react';

const tempImage = [
  "data:image/jpeg;base64,",
  "#3cb423",
  "data:image/jpeg;base64,",
  "#2c309e",
  "data:image/jpeg;base64,"
]

function App() {
  const [tempImg,setTempImg] = useState(tempImage)
  const changeTempImage = () => {
    const tempImageNew = [...tempImg].sort(() => Math.random() - 0.5)
    setTempImg(tempImageNew)
  }
  console.log(tempImg)
  const [selectedBoxImage,setSelectedBoxImage] = useState('')
  const selectedItem = (item) => {
    setSelectedBoxImage(item)
  }
  return (
    <div className="App">
      <div className="content">
        <div className="list-box">
          {tempImg.map((item,index) => {
            return (
              <BoxImage background={item} key={index} selectedItem={() => selectedItem(item)}/>
            )
          })}
        </div>
        {selectedBoxImage && (

        <div className="box-image-selected" style={{background: selectedBoxImage.slice(0,1) == '#' ? `${selectedBoxImage}` : `url(${selectedBoxImage})`}}>

        </div>
        )}
      </div>
      <ButtonRefrest onChangeTempImage={changeTempImage}>Refresh BoxImage</ButtonRefrest>
    </div>
  );
}

export default App;
